import React from 'react'
import Post from './Post'

export default function FetchedPosts({posts}) {
    if(!posts.length) {
        return <button className="btn btn-primary">Add</button>
    }
    return (posts.map((post =>(
        <Post post={post} key={post} />
    ))))
}
